func constructProductMatrix(grid [][]int) [][]int {
    n, m := len(grid), len(grid[0])
    mod := 12345

    // Initialize the product matrix
    p := make([][]int, n)
    for i := range p {
        p[i] = make([]int, m)
    }

    // Pre-compute the prefix products for rows and columns
    prefixRow := make([][]int, n)
    prefixCol := make([][]int, m)
    for i := 0; i < n; i++ {
        prefixRow[i] = make([]int, m)
        for j := 0; j < m; j++ {
            if j == 0 {
                prefixRow[i][j] = grid[i][j]
            } else {
                prefixRow[i][j] = (prefixRow[i][j-1] * grid[i][j]) % mod
            }
        }
    }
    for j := 0; j < m; j++ {
        prefixCol[j] = make([]int, n)
        for i := 0; i < n; i++ {
            if i == 0 {
                prefixCol[j][i] = grid[i][j]
            } else {
                prefixCol[j][i] = (prefixCol[j][i-1] * grid[i][j]) % mod
            }
        }
    }

    // Compute the product matrix using prefix products
    for i := 0; i < n; i++ {
        for j := 0; j < m; j++ {
            product := 1
            // Multiply by the product of the row elements excluding the current element
            if j > 0 {
                product = (product * prefixRow[i][j-1]) % mod
            }
            if j < m-1 {
                product = (product * prefixRow[i][m-1] / prefixRow[i][j]) % mod
            }
            // Multiply by the product of the column elements excluding the current element
            if i > 0 {
                product = (product * prefixCol[j][i-1]) % mod
            }
            if i < n-1 {
                product = (product * prefixCol[j][n-1] / prefixCol[j][i]) % mod
            }
            p[i][j] = product
        }
    }

    return p
}
